    false,nt"url": null,nt"notes": "This annual narrative report for the Wapello
    District of Mark Twain National Wildlife Refuge summarizes Refuge activities during
    the 1996 calendar year.  The Louisa Division, the Horseshoe Bend Division, the Big
    Timber Division, the Islands Division, and the Keithsburg Division are included.
     The report begins with a summary of the yearu2019s highlights and climatic conditions.
     Land acquisition is also covered.  The report includes a planning section which
    discusses the master plan, public participation, compliance with environmental mandates,
    research, and investigations.  Refuge administration is outlined; information about
    personnel, volunteer programs, funding, safety, and technical assistance is given.
     Habitat management is also covered.  Subjects include wetlands, forests, croplands,
    grasslands, fire management, pest control, and private lands.  The wildlife section
    of the report discusses wildlife diversity, endangered species, threatened species,
    waterfowl, marsh birds, waterbirds, shorebirds, raptors, mammals, fisheries resources,
    and animal control.  The public uses of the Refuge described in this report include
    outdoor classrooms, interpretive exhibits, hunting, fishing, trapping, wildlife
    observation, and law enforcement.  The equipment and facilities section of the report
    provides information about rehabilitation, major maintenance, equipment utilization/replacement,
    computer systems, and energy conservation.",nt"license_title": "License Not
